```typescript
import * as pulumi from "@pulumi/pulumi";
import * as fastly from "@pulumi/fastly";

const demo = new fastly.Servicev1("demo", {
    backends: [{
        address: "127.0.0.1",
        name: "localhost",
        port: 80,
    }],
    domains: [{
        comment: "demo",
        name: "demo.notexample.com",
    }],
    forceDestroy: true,
});
```
